export const DisplayButton = ({startPage,setstartPage,maxLength}) =>{
    function pageDown (){
        setstartPage(startPage-maxLength)
      }
      function pageUp(){
        setstartPage(startPage+maxLength)
      }
    return (
        <div>
            <button onClick = {pageDown} disabled={startPage<0}>&lt; Previous</button>
            {startPage}
            <button onClick = {pageUp}>Next &gt;</button>
        </div>
    )
}
